import React from "react";
import axios from "axios";
import Guarantor from "../../../components/job_application/guarantor/guarantor"
import axiosInstance from "../../../components/connection";
import { JobLayout } from "../../templates/joblayout";



class GuarantorList extends React.Component {
  state = {
    guarantor: []
  };

  fetchApplicants = () => {
    axiosInstance
    .get("job/Guarantors/").then(res => {
      this.setState({
        guarantor: res.data
      });
    });
  }

  componentDidMount() {
    this.fetchGuarantors();
  }

  componentWillReceiveProps(newProps) {
    if (newProps.token) {
      this.fetchGuarantors();      
    }
  }

  render() {
    return (
      <div>
        <JobLayout>
        <Guarantors data={this.state.guarantor} /> <br />
        </JobLayout>
      </div>
    );
  }
}

export default GuarantorList;
